import NewsLetter from '../components/NewsLetter';
import Footer from '../components/Footer';
const Container = styled.div`
  
`;
const Wrapper = styled.div`
  padding: 50px;
  display: flex;
`;
const ImgContainer = styled.div`
flex: 1;
`;
const Image = styled.img`
width: 50%;
height: 45vh;
object-fit: cover;
`;
const InfoContainer = styled.div`
  flex: 1;
`;
const Title = styled.h1`
  
`;
const Desc = styled.p`

`;
const Price = styled.span`
  
`;
const Product = () => {
  return (
    <Container>
      <Announcement/>
      <Navbar/>
      <Wrapper>
        <ImgContainer>
          <Image src="" />

          
        </ImgContainer>
        <InfoContainer>
          <Title>jacket</Title>
          <Desc>women casual wear</Desc>
          <Price>$ 20</Price>
        </InfoContainer>
      </Wrapper>
      <NewsLetter/>
      <Footer/>
    </Container>
  )
}

export default Product
